import React from 'react';
import './Button.css';

const NumberButton = props => {
  return <div>
  {props.theNumbers}
  {theNumbers.map(numberFromMap => (
              <NumberButton number={numberFromMap} key={numberFromMap} />
            ))}
  </div>;
};

export default NumberButton;
